package Numbers;

public class SwapNumbers {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int a=25;
		int b=34;
		
		System.out.println("Before Swapping: a="+a+" b="+b);
		
		//Swapping Logic	
		int temp = a;
		a=b;
		b=temp;
		
		System.out.println("After Swapping: a="+a+" b="+b);
		
		

	}

}
